import React from 'react';
import styled from 'styled-components';


const Container=styled.div`


`;
const Image=styled.img`
height:200px;
`;


const HomeContent = () => {
  return (
    <div>
    <Container>
    <Image src="images/logo.jpg"></Image>
    </Container>
    </div>
  );
}

export default HomeContent;
